script: |
  super -f text -I q78.spq | sort > q78.out

inputs:
  - name: q78.spq
    data: |
      SELECT DISTINCT col1 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT ( NULL ) NOT BETWEEN 18 * + ( col2 ) AND ( + col0 * - 42 + 38 ) OR NULL IS NOT NULL;
  - name: tab2

outputs:
  - name: q78.out
    data: |
